import React from 'react';

export default () => (
  <svg width="1em" height="1em" viewBox="0 0 24 24" version="1.1">
    <g fill="currentColor" fillRule="evenodd">
      <circle cx="12" cy="4" r="2" />
      <circle cx="12" cy="12" r="2" />
      <circle cx="12" cy="20" r="2" />
    </g>
  </svg>
);
